import React, {Component} from 'react';
import '../Box/Box.css';

import { Card } from 'react-bootstrap';

export class Box extends Component {

    render() {
        return(
            <Card isSelected={this.props.isSelected} className="Box">
            <div className="BoxDiv">
              {this.props.text}
            </div>
          </Card>
        );
    }
}
